import React, { useState, useEffect } from 'react';

const Counter = () => {
    const [count, setCount] = useState(0);

    useEffect(() => {
        document.title = `${count} click(s)`;
    });

    const upCount = () => {
        setCount(count + 1);
    }

    return (
        <div>
            <p>{count}</p>
            <button onClick = {upCount}>Up Count</button>
        </div>
    )
}

export default Counter;
